// 0: {path: 'd3', leaf: 'd3', module: null, size: 1}
// 1: {path: 'd3/d3-array', leaf: 'd3-array', module: 'd3-array', size: 1}
// ...
const nodes = [],
  // 0: {source: 'd3', target: 'd3/d3-array'}
  // 1: {source: 'd3/d3-array', target: 'd3/d3-array/threshold'}
  links = [];
for (const pkg of d3DependenciesRaw) {
  const { size, path } = pkg;
  const levels = path.split('/'),
    module = levels.length > 1 ? levels[1] : '', // coarse null to '' for grouping
    leaf = levels.pop(),
    parent = levels.join('/');

  nodes.push({
    path,
    leaf,
    module,
    size: +size || 1,
  });

  if (parent) {
    links.push({
      source: parent,
      target: path,
    });
  }
}

const linkTypes = ['leng', 'l', 'lengt', 'le', 'len', 'length'];

// console.log('dependencies links: ', links);
const moduleSet = new Set(nodes.map((n) => n.module));
export const dependenciesTypes = [...moduleSet];

export default function d3DependencyGraph() {
  const nodeTypeMap = new Map();
  const graph = new Graph('dependencies');
  for (const n of nodes) {
    // node.moudle will be used as vertex.type for TigerGraph
    graph.addNode({ id: n.path, type: n.module, data: { ...n, group: n.module } });
    nodeTypeMap.set(n.path, n.module);
  }
  for (const l of links) {
    graph.addLink({
      fromId: l.source,
      fromType: nodeTypeMap.get(l.source),
      toId: l.target,
      toType: nodeTypeMap.get(l.target),
      type: linkTypes[Math.floor(Math.random() * linkTypes.length)],
      discriminator: '',
      directed: true,
    });
  }

  return graph;
}
